import styles from './Navb.module.css';
import { FaInstagram, FaGithub, FaLinkedin } from "react-icons/fa";
import { Navbar, Nav } from 'react-bootstrap';

function Navb() {
    return (
        <Navbar className={styles.Navb}>
            <Nav>
                <ul>
                    <li><Nav.Link href='#Presentation'>Projects</Nav.Link></li>
                    <li></li>
                    <li></li>
                </ul>
            </Nav>

            <Nav>
                <ul>
                    <li><FaInstagram size={30} /></li>
                    <li><FaGithub size={30} /></li>
                    <li><FaLinkedin size={30} /></li>
                </ul>
            </Nav>
        </Navbar>
    );
}

export default Navb;
